import React from 'react';
import ReactDOM from 'react-dom';
import './styles/Modal.css';
const Modal = (props) =>{
  return ReactDOM.createPortal(
    <div className="ModalBackground">
        props.children}
    </div>,
    document.getElementById('modal')
  );
}

export default Modal ;
